import React from 'react';
import { Box, Button } from '@mui/material';
import { Link } from 'react-router-dom';

const TrainerDashboard = () => {
  return (
    <Box sx={{ padding: 2 }}>
      <h3>Trainer Dashboard</h3>
      <Button variant="contained" sx={{ marginBottom: 2 }}>
        <Link to="/trainer/create-plan" style={{ textDecoration: 'none', color: 'white' }}>
          Create Plan
        </Link>
      </Button>
      <Button variant="contained" sx={{ marginBottom: 2 }}>
        <Link to="/trainer/view-groups" style={{ textDecoration: 'none', color: 'white' }}>
          View Groups
        </Link>
      </Button>
      <Button variant="contained">
        <Link to="/trainer/progress" style={{ textDecoration: 'none', color: 'white' }}>
          View Progress
        </Link>
      </Button>
    </Box>
  );
};

export default TrainerDashboard;
